import styled from 'styled-components';
import { themeGet } from '@styled-system/theme-get';

export const Title = styled.h2`
    text-transform: uppercase;
    letter-spacing: 2px;
    margin-bottom: 0px;
    padding-bottom: 1rem;
    line-height: 1;
    font-size: 1.75rem;
    font-weight: 700;
`;
